import './index.css';

function TodoItem({ text, completed }) {
   return (
      <li className="TodoItem">
         <div>
            <span>V</span>
            <p className='TodoItemText'>{text}</p>
         </div>
         <span>
            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor" className="TodoItemDeleteIcon">
               <path strokeLinecap="round" strokeLinejoin="round" d="M6 18L18 6M6 6l12 12" />
            </svg>
         </span>
      </li>
   );
}

export { TodoItem };
